def calculate_inning_score(events):
    out_cnt = 1
    score = 0
    runner = [0, 0, 0, 0]
    for event in events:
        if event == 'OUT':
            out_cnt += 1
            if out_cnt == 3:
                break
        elif event == 'HIT':
            if 1 in runner:
                for ind in range(len(runner) - 1, -1, -1):
                    if runner[ind] == 1:
                        if ind != 3:
                            runner[ind] = 0
                            runner[ind + 1] = 1
                            if not 1 in runner[:ind]:
                                break
                if runner[-1] == 1:
                    runner[-1] = 0
                    score += 1
                runner[0] = 1
            else:
                runner[0] = 1
        elif event == 'HOMERUN':
            score += sum(runner) + 1
            runner = [0, 0, 0, 0]
    return score

